import { useEffect } from "react";
import Loader from "../components/Loader";
import Message from "../components/Message";
import { listContacts, deleteContact } from "../actions/contactActions";
import { useDispatch, useSelector } from "react-redux";
import { CONTACT_CREATE_RESET } from "../constants/contactConstants";

const AdminContactListScreen = () => {
  const dispatch = useDispatch();

  const contactList = useSelector((state) => state.contactList);
  const { loading, error, contacts } = contactList;

  const contactDelete = useSelector((state) => state.contactDelete);
  const {
    loading: loadingDelete,
    error: errorDelete,
    success: successDelete,
  } = contactDelete;

  const userLogin = useSelector((state) => state.userLogin);
  const { userInfo } = userLogin;

  useEffect(() => {
    dispatch({ type: CONTACT_CREATE_RESET });
  });

  return (
    <div className="container">
      <div className="row">
        <div className="col-md-8 offset-md-2 my-4">
          <div className="col">
            <h3>Contact List</h3>
          </div>

          <table className="table table-dark table-striped">
            <thead>
              <tr>
                <th scope="col">ID</th>
                <th scope="col">NAME</th>
                <th scope="col">PHONE</th>
                <th scope="col">EMAIL</th>
                <th scope="col">HAVE READ?</th>
                <th scope="col"></th>
                <th scope="col"></th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>1234</td>
                <td>Test Name</td>
                <td>Test Phone</td>
                <td>Test Email</td>
                <td>No</td>
                <td>
                  <button className="btn btn-primary">View Details</button>
                </td>
                <td>
                  <button className="btn btn-danger">Delete</button>
                </td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default AdminContactListScreen;
